description:
The overlooked sequel miniseries to Slap Leather, The Sensational Seven chronicles another Rawhide Kid adventure of Marvel's (and possibly the world's) first mainstream media gay cowboy character.

And it's damn funny to boot.

&quot;Why don't you shut your filthy mouth, you filthy old man?&quot;

&quot;Maybe I would, if your sentence construction was a little better.&quot;

All credit to the original scanners.
